      | 25812 -> { ItemTypeData.id= 25812; name= "Gas Cloud Harvester II"; published= true; description= "The core technology employed by Gas Harvesters dates back centuries, to a time when the extraction of material in space was still a growing industry. Originally, asteroid miners had seen the tractor beams and in-space catalytic conversions used by today's Gas Harvesters as a promising new method for extracting spacebound ore. After many unsuccessful research projects and years of fruitless experiments however, the industry decided to return its focus to laser technology, which was eventually mastered to a level that has sustained the mining profession to this day.    When the first interstellar Gas Clouds were discovered, they proved particularly challenging for industrialists to extract raw materials from. Many methods were tried, and although successful acquisition was always guaranteed, there was a need for much greater efficiency. It was not until the mining industry returned to long-abandoned projects that a solution was found. Since that time, Gas harvesting technology has slowly moved forward, giving birth to new industries and economies in the process.     Research interest picked back up in Gas Harvesting technology when new, stable wormholes began proliferating across the cluster. As soon as the wormholes were discovered, so too, were the giant gas cloud pockets within the unknown systems they linked to. In a single day, the demand for Tech II Gas Cloud Harvester exploded. Research projects were hastily established and grants hurriedly thrown out to the most promising firms pursuing a redesign. It was only a few days before a breakthrough was made, and all the harvesting technology that had come before was quickly relegated to second place. "; marketGroupId= Some(1037); groupId= 737; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 5.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 25.000000 }; { DogmaAttributeValueD